import { moduleMetadata } from '@storybook/angular';
import { NxWelcomeComponent } from './nx-welcome.component';
export default {
    title: 'NxWelcomeComponent',
    component: NxWelcomeComponent,
    decorators: [
        moduleMetadata({
            imports: [],
        }),
    ],
};
const Template = (args) => ({
    props: args,
});
export const Primary = Template.bind({});
Primary.args = {};
